import { View, Pressable } from 'react-native';
import NavigateButtonIcon from './NavigateButtonIcon';

export default function NavigateButton({ isFocusClock, onPress }) {
  return (
    <View>
      <Pressable onPress={onPress}>
        <console.log>isFocusClock is {isFocusClock}</console.log>
        <NavigateButtonIcon isFocusClock={isFocusClock} />
      </Pressable>
    </View>
  );
}
